import React, { Component } from 'react';
import './Section.css';
import TextLoop from "react-text-loop";

class Section extends Component {

    // props are :headerText :list of body
    constructor(props) {
        super(props);
      }

    render(){    
        return (
            <div className="right-align">
                <h1 className="large-title">Hi there, I'm Laura</h1>
                <h4 className="large-subtitle">thanks for checking out my portfolio today</h4>
                <br/>
                <h5 className="small-subtitle">I AM A:</h5>
                {/* subtitle that alternates text */}
                <h2>
                    I am 
                    <TextLoop>
                        <span>a junior at Brown University</span>
                        <span>a Computer Science major</span>
                        <span>a designer and visual artist</span>
                    </TextLoop>{" "}
            </h2>
            </div>
        );
    }
}

export default Section;
